import React, { useEffect, useState } from "react";
import Item from "./DisplayTeddies"
import axios from "axios";

const URL = "http://Localhost:5000/items"

const fetchHandler = async ()=>{
    return await axios(URL).then((res)=>res.data);
}

function TeddyBares(props) {
    const [,itemname,getprice ,sellprice ,pices, date ] = props.item;

    const [items,setItems]= useState();

    useEffect(()=>{
        fetchHandler().then((data)=>setItems(data.items));
    },[])
  return (
    <div>

        <div>
            {items && items.map((item,i)=>(
                <div key = {i}>
                    <Item item ={item}/>
                    </div>
            ))}
        </div>
        <h1>{itemname}</h1>
        <h1>{getprice}</h1>
        <h1>{sellprice}</h1>
        <h1>{pices}</h1>
        <h1>{date}</h1>
        
        
      
    </div>
  )
}

export default TeddyBares
